import React from "react";
import {Link} from 'react-router-dom';


function CaseThumbnails() {
  return (
    <div className="caseThumbnails">
        <Link to="/work/JasonClerkID"><div className="thumbnail"></div></Link>
        <Link to="/work/SugarFlower"><div className="thumbnail"></div></Link>
        <Link to="/work/Canada150"><div className="thumbnail"></div></Link>
        <Link to="/work/McDonaldsGCTA"><div className="thumbnail"></div></Link>
    </div>
  );
}

export default CaseThumbnails;
